            placeholder="Confirm Password"
            name="password2"
            minLength="6"
            value={password}
          />
        </div>
        <input type="submit" class="btn btn-primary" value="Register" />
      </form>
      <p className="my-1">
        Already have an account? <a href="login.html">Sign In</a>
      </p>
    </section>

  );
};

export default Register;
